    // --- NOVA FUNO: FAXINEIRO DE FOTOS ---
    cleanupHistory(history) {
        if (!history || !Array.isArray(history)) return [];
        
        const NOW = new Date();
        const LIMIT_DAYS = 60; // Ciclo de 2 meses

        return history.map(entry => {
            // Se no tiver data, ignora
            if (!entry.date) return entry;

            // Calcula a diferena de dias
            const entryDate = new Date(entry.date + 'T12:00:00');
            const diffTime = Math.abs(NOW - entryDate);
            const diffDays = Math.ceil(diffTime / (1000 * 60 * 60 * 24));

            // Se for mais velho que 60 dias e tiver fotos, apaga AS FOTOS (mantm o texto)
            if (diffDays > LIMIT_DAYS && entry.photos && entry.photos.length > 0) {
                console.log(`[Auto-Limpeza] Apagando fotos antigas de: ${entry.date}`);
                delete entry.photos; // Remove a propriedade de fotos para liberar espao
            }
            return entry;
        });
    },

    // --- SALVAR VECULO (ATUALIZADO COM O CICLO) ---
    async saveVehicle(e) {
        e.preventDefault();
        let id = document.getElementById('veh-id').value || Date.now();
        let old = this.vehicles.find(v => v.id == id);
        let hist = old ? (old.maintenanceHistory || []) : [];

        const status = document.getElementById('f-status').value;
        const workshopName = status === 'Manuteno' ? document.getElementById('f-oficina').value : '';

        if(status === 'Manuteno' && !workshopName) return alert("Selecione a oficina!");

        const newDate = document.getElementById('f-manu-ultima').value;
        const newDesc = document.getElementById('f-pecas').value;

        // Se tiver nova manuteno, salva COM AS FOTOS NO HISTRICO
        if (newDate && newDesc) {
            hist.push({ 
                date: newDate, 
                desc: newDesc, 
                km: document.getElementById('f-km').value, 
                recordedAt: new Date().toISOString(),
                // AQUI: Salva as fotos dentro do histrico para o relatrio pegar depois
                photos: [...this.tempPhotos] 
            });
        }

        // RODAR A LIMPEZA (Apaga fotos > 60 dias)
        hist = this.cleanupHistory(hist);

        const veh = {
            id: parseInt(id),
            _collection: this.collectionName,
            _syncStatus: 'pending',
            placa: document.getElementById('f-placa').value.toUpperCase(),
            modelo: document.getElementById('f-modelo').value,
            status: status,
            workshopName: workshopName,
            km: document.getElementById('f-km').value,
            manutencao: {
                ultima: newDate,
                proxima: document.getElementById('f-manu-proxima').value,
                pecas: newDesc,
                pendencias: document.getElementById('f-pendencias').value
            },
            maintenanceHistory: hist, // Salva o histrico j limpo
            observacoes: document.getElementById('f-obs').value,
            // As fotos 'atuais' (tempPhotos) ficam apenas para visualizao rpida no card
            fotos: this.tempPhotos, 
            updatedAt: new Date().toISOString()
        };

        if (!old) this.vehicles.push(veh);
        else this.vehicles[this.vehicles.findIndex(v => v.id == id)] = veh;

        await this.updateLocalBackup(this.vehicles);
        this.closeModal();
        this.renderList();
        if(navigator.onLine) this.syncNow(true);
    },

    // --- RELATRIO (ATUALIZADO PARA PEGAR FOTOS DO HISTRICO) ---
    async generatePeriodReport() {
        const type = document.getElementById('rep-type').value;
        const start = document.getElementById('rep-start').value;
        const end = document.getElementById('rep-end').value;
        
        if(!start || !end) return alert("Selecione as datas");

        const { jsPDF } = window.jspdf;
        const doc = new jsPDF();

        let allVehicles = [];
        if (type === 'global') {
            for (const sec of this.sectors) {
                const snap = await this.db.collection(`frota_${sec}`).get();
                snap.forEach(doc => allVehicles.push(doc.data()));
            }
        } else {
            allVehicles = this.vehicles;
        }

        // CAPA
        if(LOGO_BASE64) await this.drawSmartLogo(doc, LOGO_BASE64, 55, 60, 100, 60);
        doc.setFontSize(22); doc.text("RELATRIO DE GESTO DE FROTA", 105, 140, {align:"center"});
        doc.setFontSize(14); doc.text(type === 'global' ? "Relatrio Geral (Todas Secretarias)" : `Setor: ${this.currentLocation}`, 105, 155, {align:"center"});
        doc.setFontSize(12); doc.text(`${this.fmtDate(start)} a ${this.fmtDate(end)}`, 105, 165, {align:"center"});
        
        doc.addPage();
        let body = [];
        // Lista para armazenar fotos vinculadas a uma manuteno especfica
        let maintenancePhotos = []; 
        const dStart = new Date(start); const dEnd = new Date(end);

        allVehicles.forEach(v => {
            if(v.maintenanceHistory) {
                v.maintenanceHistory.forEach(log => {
                    const d = new Date(log.date);
                    if(d >= dStart && d <= dEnd) {
                        body.push([this.fmtDate(log.date), v.placa, v.modelo, log.desc, v.workshopName || '-']);
                        
                        // Se esse registro histrico tiver fotos (e no tiverem sido apagadas pelo ciclo de 60 dias)
                        if(log.photos && log.photos.length > 0) {
                            maintenancePhotos.push({
                                placa: v.placa,
                                modelo: v.modelo,
                                date: log.date,
                                images: log.photos
                            });
                        }
                    }
                });
            }
        });

        if(body.length===0) return alert("Nada encontrado.");

        doc.autoTable({
            startY: 20, head: [['Data', 'Placa', 'Modelo', 'Servio', 'Oficina']], body: body, theme:'grid'
        });

        // FOTOS (VINCULADAS  DATA)
        if(maintenancePhotos.length > 0) {
            doc.addPage();
            doc.text("REGISTROS FOTOGRFICOS DO PERODO", 105, 20, {align:"center"});
            let y = 30;
            
            for(const item of maintenancePhotos) {
                if(y > 250) { doc.addPage(); y=20; }
                
                doc.setFillColor(230,230,230);
                doc.rect(14, y-5, 182, 8, 'F');
                doc.setFontSize(10); 
                doc.text(`${item.placa} - ${this.fmtDate(item.date)}`, 16, y);
                y += 10;

                // Loop das fotos deste registro
                let xPos = 15;
                for (let i = 0; i < item.images.length; i++) {
                    if(y > 260) { doc.addPage(); y = 20; }
                    await this.drawSmartLogo(doc, item.images[i], xPos, y, 50, 40);
                    xPos += 60; // Move para o lado
                    
                    // Quebra linha a cada 3 fotos
                    if(xPos > 180) {
                        xPos = 15;
                        y += 45;
                    }
                }
                y += 50; // Espao para o prximo veculo
            }
        }

        doc.save(`Relatorio_${type}.pdf`);
        document.getElementById('report-modal').style.display = 'none';
    },

