    toggleWorkshopSelect() { const status = document.getElementById('f-status').value; const div = document.getElementById('div-oficina'); if(status === 'Manuteno') div.style.display = 'block'; else div.style.display = 'none'; },
    async openDashboard() { document.getElementById('dashboard-modal').style.display = 'flex'; const list = document.getElementById('dashboard-workshops-list'); list.innerHTML = '<p>Carregando...</p>'; let totalCars = 0; let maintenanceCars = 0; let carsByWorkshop = {}; for (const sec of this.sectors) { const snap = await this.db.collection(`frota_${sec}`).get(); snap.forEach(doc => { const car = doc.data(); totalCars++; if(car.status === 'Manuteno') { maintenanceCars++; const oficina = car.workshopName || 'No Informada'; if(!carsByWorkshop[oficina]) carsByWorkshop[oficina] = []; carsByWorkshop[oficina].push({ ...car, sector: sec }); } }); } document.getElementById('dash-total').innerText = totalCars; document.getElementById('dash-maintenance').innerText = maintenanceCars; list.innerHTML = ''; if(maintenanceCars === 0) { list.innerHTML = '<p style="text-align:center;color:green;">Nenhum veculo em manuteno!</p>'; return; } for (const [oficina, cars] of Object.entries(carsByWorkshop)) { const group = document.createElement('div'); group.className = 'workshop-group'; let html = `<div class="workshop-header"> ${oficina} (${cars.length})</div>`; cars.forEach(c => { html += `<div class="workshop-item"><div><strong>${c.placa}</strong> - ${c.modelo}</div><div style="font-size:0.8rem; background:#0056b3; color:white; padding:2px 6px; border-radius:4px;">${c.sector}</div></div>`; }); group.innerHTML = html; list.appendChild(group); } },
    renderSectorButtons() { const list=document.getElementById('sector-list'); const nav=document.getElementById('nav-sector'); if(!list)return; list.innerHTML=''; nav.innerHTML='<option value="" disabled selected>Setor</option>'; this.sectors.forEach(sec=>{ const btn=document.createElement('button'); btn.className='btn-location'; btn.innerHTML=`<span class="material-icons" style="font-size:30px; margin-bottom:5px;">business</span>${sec}`; btn.onclick=()=>this.selectLocation(sec); list.appendChild(btn); const opt=document.createElement('option'); opt.value=sec; opt.innerText=sec; nav.appendChild(opt); }); },
